import React, { Component } from 'react';

export default class News extends Component {
  render() {
    return (
      <div className="news">
        <h3>News</h3>
        <div>
          <p>11th April 2019</p>
          <h2>EP COMING SOON</h2>
        </div>
      </div>
    );
  }
}
